import React, { useState } from 'react';
import Modal from 'react-bootstrap/Modal';
import Download from '../Download/Download';

export default function ImgFullScreen({show, setShow, title, src, hrefDownload, Bu, setBu}) {



    return (
        <>
            <Modal show={show} fullscreen={true} onHide={() => setShow(false)} className='ImgFullScreen'>
                <Modal.Body>
                    <img className='img-fluid' alt='random image' src={src} />
                    <div></div>
                </Modal.Body>
                <Modal.Header closeButton><button type="button" onClick={() => setShow(false)}>{Bu? 'Hola' : 'Chau'}</button></Modal.Header>
                <Modal.Footer>
                    <Modal.Title>{title}</Modal.Title>
                    <Download title={title} href={hrefDownload}/>
                </Modal.Footer>
            </Modal>
        </>
    );
}
